import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="calculator_wrap">
        <div className = "row">
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
        </div>
        <div className = "row">
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
        </div>
        <div className = "row">
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
          <div className = "box">1</div>
        </div>
      </div>
    </div>
  );
}

export default App;
